import React, { useState, useEffect } from 'react';
import { jsPDF } from 'jspdf';
import autoTable from 'jspdf-autotable';
import StarryBackground from "@/components/StarryBackground";
import BackButton from '@/components/BackButton';
import ScrollToTopButton from '@/components/scrollup';
import { motion } from 'framer-motion';

const QuoteManager = () => {
  const [projectId, setProjectId] = useState('');
  const [projects, setProjects] = useState([]);
  const [customer, setCustomer] = useState(null);
  const [categories, setCategories] = useState([]);
  const [itemsByCategory, setItemsByCategory] = useState({});
  const [selectedItems, setSelectedItems] = useState({});
  const [additionalCost, setAdditionalCost] = useState(0);
  const [totalCost, setTotalCost] = useState(0);
  const [searchFilters, setSearchFilters] = useState({});
  const [isLoading, setIsLoading] = useState(false);
  const [generatedQuote, setGeneratedQuote] = useState(null);
  const [successMessage, setSuccessMessage] = useState(''); 
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    fetch('/api/projects')
      .then((response) => response.json())
      .then((data) => setProjects(data))
      .catch((err) => console.error('Error fetching projects:', err));
  }, []);

  useEffect(() => {
    if (projectId) {
      setIsLoading(true);
      Promise.all([
        fetch(`/api/customer/${projectId}`).then((res) => res.json()),
        fetch('/api/category').then((res) => res.json()),
      ])
        .then(([customerRes, categoriesRes]) => {
          setCustomer(customerRes);
          setCategories(categoriesRes);
        })
        .catch((err) => console.error('Error fetching data:', err))
        .finally(() => setIsLoading(false));
    }
  }, [projectId]);

  useEffect(() => {
    if (categories.length > 0) {
      categories.forEach((category) => {
        fetch(`/api/items/${category.category_id}`)
          .then((res) => res.json())
          .then((data) => {
            setItemsByCategory((prev) => ({
              ...prev,
              [category.category_id]: data,
            }));
          })
          .catch((err) => console.error(`Error fetching items for category ${category.category_name}:`, err));
      });
    }
  }, [categories]);

  useEffect(() => {
    const selectedCosts = { Drip: 0, Plumbing: 0, Automation: 0, Labour: 0,Electronics: 0,Pumping: 0,Tools: 0 };

    Object.entries(selectedItems).forEach(([categoryId, items]) => {
      items.forEach((item) => {
        const categoryName = categories.find(
          (cat) => cat.category_id === parseInt(categoryId)
        )?.category_name;
        if (categoryName && selectedCosts.hasOwnProperty(categoryName)) {
          selectedCosts[categoryName] += item.cost * item.quantity;
        }
      });
    });

    const total = Object.values(selectedCosts).reduce((acc, cost) => acc + (cost || 0), 0) + parseFloat(additionalCost || 0);
    setTotalCost(total);
  }, [selectedItems, additionalCost, categories]);

  const handleItemSelection = (categoryId, item_id, cost) => {
    setSelectedItems((prev) => {
      const categoryItems = prev[categoryId] || []; // Get existing items in category
      const itemExists = categoryItems.some((item) => item.item_id === item_id);
  
      if (itemExists) {
        // Remove item if already selected
        return {
          ...prev,
          [categoryId]: categoryItems.filter((item) => item.item_id !== item_id),
        };
      } else {
        // Add new item
        return {
          ...prev,
          [categoryId]: [
            ...categoryItems,
            { item_id, cost: parseFloat(cost) || 0, quantity: 1 },
          ],
        };
      }
    });
  };
  

  const handleQuantityChange = (categoryId, item_id, quantity) => {
    setSelectedItems((prev) => {
      const categoryItems = prev[categoryId] || [];
      const updatedItems = categoryItems.map((item) =>
        item.item_id === item_id ? { ...item, quantity: parseInt(quantity) } : item
      );
      return {
        ...prev,
        [categoryId]: updatedItems,
      };
    });
  };

  const fetchLastQuoteId = async () => {
    try {
      const res = await fetch('/api/last-quote-id');
      const data = await res.json();
      return data.nextQuoteId;
    } catch (err) {
      console.error('Error fetching last quote ID:', err);
      return null;
    }
  };

// Generate PDF of the quote
const generateQuote = async () => {
  const quoteId = await fetchLastQuoteId(); // Get the next quote ID
  const quoteDate = new Date().toLocaleDateString('en-GB', { 
    day: '2-digit', 
    month: 'long', 
    year: 'numeric' 
  });
   // Get the current date
  const doc = new jsPDF();

//doc.setDrawColor(0, 128, 0); // Green color
//doc.setLineWidth(3);
//doc.line(20, 5, 190, 5);  
const logo = 'data:image/jpeg;base64,';

// Add Title
// Set light blue background
doc.setFillColor(173, 216, 230); // RGB for light blue
doc.rect(15, 15, 180, 20, 'F'); // Draw filled rectangle (x, y, width, height)

// Add title text
doc.setFont('helvetica', 'bold');
doc.setFontSize(18);
doc.setTextColor(0, 0, 0); // Ensure text is black
doc.text('Ukshati Technologies Pvt Ltd.', 20, 30); // Adjust y position for better alignment

// Add logo
doc.addImage(logo, 'JPEG', 150, 10, 30, 30);


  // Add Company Details below the title
  doc.setFont('helvetica', 'normal');
  doc.setFontSize(12);
  // doc.text('Pvt. Ltd.', 20, 35);
  doc.text('2nd floor, Pramod Automobiles bldg.', 20, 43);
  doc.text('Karangalpady', 20, 51);
  doc.text('Mangalore - 575003', 20, 59);
  doc.text('Karnataka', 20, 67);
  doc.text('Phone: + 91 8861567365', 20, 75);
  doc.textWithLink('www.ukshati.com', 20, 83, { url: 'http://www.ukshati.com' });

  // Draw a thin dark blue line below the address (left side)
  doc.setDrawColor(0, 0, 139); // Dark blue (RGB: 0,0,139)
  doc.setLineWidth(1);
  doc.line(20, 88, 100, 88);

     // Add Quote ID and Customer Info below the line
 // Add Quote ID, Date, and Customer Info below the line
doc.setFont('helvetica', 'bold');
doc.setFontSize(12);
doc.text(`Quote ID: ${quoteId}                                                                             Date: ${quoteDate}`, 20, 100); // Added Date
doc.text(`Customer: ${customer?.customer_name}                                Address: ${customer?.address}`, 20, 108);

doc.text(`Phone: ${customer?.cphone}`, 20, 116);


// Add Logo at the top-right

// Set starting Y for the cost breakdown table
let startY = 125;

// Prepare table rows for cost breakdown per category (only if value > 0)
const tableRows = categories
  .map((category) => {
    const categoryTotal =
      selectedItems[category.category_id]?.reduce(
        (sum, item) => sum + item.cost * item.quantity,
        0
      ) || 0;

    return categoryTotal > 0 ? [category.category_name, `Rs ${categoryTotal.toFixed(2)}`] : null;
  })
  .filter(Boolean); // Remove null values

// Add Additional Cost row if applicable
if (parseFloat(additionalCost) > 0) {
  tableRows.push(['Additional Cost', `Rs ${parseFloat(additionalCost).toFixed(2)}`]);
}

// Add Total Cost row at the bottom with a unique style
const totalCostRow = ['Total Cost', `Rs ${totalCost.toFixed(2)}`];

autoTable(doc, {
  head: [['Category', 'Cost']],
  body: [...tableRows, totalCostRow], // Append total cost row
  startY: startY,
  theme: 'grid',
  headStyles: { fillColor: [0, 128, 0], halign: 'center' },
  styles: { fontSize: 12, halign: 'center' },
  didParseCell: function (data) {
    // Make "Total Cost" row bold and highlighted
    if (data.row.index === tableRows.length) {
      data.cell.styles.fontStyle = 'bold';
      data.cell.styles.fillColor = [255, 204, 0]; // Light Yellow Background
    }
  }
});

// Add Total Cost
const finalY = doc.lastAutoTable.finalY + 5; // Reduced spacing

const bottomY = finalY + 10;
  
// Left side: QR code image (scanner image). Replace with your actual Base64 string.
const qrCode = 'data:image/jpeg;base64,';
doc.addImage(qrCode, 'PNG', 20, bottomY, 40, 40);
const bankXOffset = 45;  // Change this value to shift more to the right
  const bankX = 80 + bankXOffset; // Current starting x for bank details plus offset
  const bankYOffset = 5; // Vertical offset from the top of the QR code
  
  doc.setFont('helvetica', 'normal');
  doc.setFontSize(10);
  doc.text('Bank Details:-', bankX, bottomY + bankYOffset);
  doc.text('ICICI Bank', bankX, bottomY + bankYOffset + 6);
  doc.text('Name:- Ukshati Technologies Private Limited', bankX, bottomY + bankYOffset + 12);
  doc.text('Account Number - XXXXXXXXXXXXXXX', bankX, bottomY + bankYOffset + 18);
  doc.text('IFSC Code - XXXXXXXX', bankX, bottomY + bankYOffset + 24);
  // Right side: Bank Details and Special Notes

  
  // Move Special Notes to further right (e.g., x = 200)
  const greenLineY = bottomY + 45; // 5 units below the QR code (which is 40px tall)
  doc.setDrawColor(0, 128, 0); // Green color (RGB: 0,128,0)
  doc.setLineWidth(3);       // Thick line
  doc.line(20, greenLineY, 190, greenLineY);  // Draw line from x=20 to x=190
  
  // 3. Add Special Notes below the green line (starting a little further down)
  const specialNotesY = greenLineY + 10; // 10 units below the green line
  doc.setFont('helvetica', 'normal');
  doc.setFontSize(10);
  doc.text('Special Notes:', 20, specialNotesY);
  doc.text('Two-year warranty included.', 20, specialNotesY + 6);
  doc.text('SIM card not included in the package.', 20, specialNotesY + 12);
  doc.text('Payment terms: 70% advance, 30% after installation.', 20, specialNotesY + 18);
  doc.text('Extra work charged separately.', 20, specialNotesY + 24);
  doc.text('Wi-Fi extender extra if signal weak.', 20, specialNotesY + 30);
  doc.text('Quote validity: 6 months from date of issue.', 20, specialNotesY + 36);

    const pdfData = doc.output('dataurlstring');
    setGeneratedQuote(pdfData);
    // doc.save('generated-quote.pdf');
  };

  const saveQuote = () => {
    setLoading(true); 
    const categoryCosts = categories.reduce((acc, category) => {
      const items = selectedItems[category.category_id] || [];
      acc[`${category.category_name.toLowerCase()}_cost`] = items.reduce((sum, item) => sum + item.cost * item.quantity, 0);
      return acc;
    }, {});

    fetch('/api/save-quote', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        project_id: projectId,
        customer_name: customer?.customer_name,
        ...categoryCosts,
        additional_cost: parseFloat(additionalCost),
        total_cost: totalCost,
      }),
    })
      .then((res) => res.json())
      .then((data) => {
        console.log('Quote saved:', data);
        setSuccessMessage('Quote saved successfully!');
        setLoading(false); 
      })
      .catch((err) => {
        console.error('Error saving quote:', err);
        setLoading(false); 
      });
  };

  const handleSearchChange = (categoryId, value) => {
    setSearchFilters((prev) => ({
      ...prev,
      [categoryId]: value,
    }));
  };

  const getFilteredItems = (categoryId) => {
    const filter = searchFilters[categoryId]?.toLowerCase() || '';
    const items = itemsByCategory[categoryId] || [];
    if (!filter) return [];
    return items.filter((item) =>
      item.item_name.toLowerCase().includes(filter)
    );
  };
  

  return (
    <div className="bg-cover bg-center text-white">
        <StarryBackground/>
        <ScrollToTopButton/>
       {/* Back Button (Unchanged) */}
       <BackButton route='/quotation/home'/>
      <div className="flex flex-col mt-20 bg-cover bg-center text-white items-center justify-center">
      <h1 className="text-3xl font-bold mb-6">Quote Management</h1>
  
      {/* New Animated Card */}
      <motion.div
        className="bg-gray-900 bg-opacity-90 p-6 rounded-lg shadow-lg w-full max-w-4xl"
        initial={{ opacity: 0, y: 50 }} // Initial animation state
        animate={{ opacity: 1, y: 0 }} // Animate to this state
        transition={{ duration: 0.5 }} // Animation duration
      >
        <label className="text-white">Select Project ID:</label>
        <select
          onChange={(e) => setProjectId(e.target.value)}
          value={projectId}
          className="bg-gray-700 text-white"
          style={{
            padding: '10px',
            margin: '10px 0',
            borderRadius: '5px',
            border: '1px solid #ddd',
            width: '50%',
          }}
        >
          <option value="">-- Select Project --</option>
          {projects.map((proj) => (
            <option key={proj.pid} value={proj.pid}>
              {proj.pname}
            </option>
          ))}
        </select>
  
        {customer && (
          <p className="text-white">
            <strong>Customer:</strong> {customer.customer_name}
          </p>
        )}
  
  {categories.map((cat) => (
        <div key={cat.category_id} style={{ marginBottom: '20px', width: '100%' }}>
          <h3 className="text-white" style={{ marginBottom: '10px' }}>
            {cat.category_name}
          </h3>
          <input
            type="text"
            placeholder={`Search items in ${cat.category_name}`}
            value={searchFilters[cat.category_id] || ''}
            onChange={(e) => handleSearchChange(cat.category_id, e.target.value)}
            className="bg-gray-700 text-white"
            style={{
              padding: '10px',
              marginBottom: '10px',
              width: '50%',
              borderRadius: '5px',
              border: '1px solid #ddd',
            }}
          />

          {getFilteredItems(cat.category_id)?.map((item) => (
            <motion.div
              key={item.item_id}
              style={{ display: 'flex', alignItems: 'center', marginBottom: '10px' }}
              initial={{ opacity: 0, x: -20 }}
              animate={{ opacity: 1, x: 0 }}
              transition={{ duration: 0.3 }}
            >
              <input
                type="checkbox"
                id={`item-${item.item_id}`}
                onChange={() => handleItemSelection(cat.category_id, item.item_id, item.price_pu)}
                checked={selectedItems[cat.category_id]?.some((i) => i.item_id === item.item_id) || false}
                style={{ marginRight: '10px' }}
              />
              <label htmlFor={`item-${item.item_id}`} className="text-white" style={{ flex: 1 }}>
                {item.item_name} (₹{item.price_pu})
              </label>
              {selectedItems[cat.category_id]?.some((i) => i.item_id === item.item_id) && (
                <div
                  style={{
                    display: 'flex',
                    justifyContent: 'space-between',
                    alignItems: 'center',
                    width: '50%',
                  }}
                >
                  <input
                    type="number"
                    value={selectedItems[cat.category_id]?.find((i) => i.item_id === item.item_id)?.quantity || 1}
                    min="1"
                    onChange={(e) => handleQuantityChange(cat.category_id, item.item_id, e.target.value)}
                    className="bg-gray-700 text-white"
                    style={{
                      padding: '5px',
                      width: '50px',
                      borderRadius: '4px',
                      border: '1px solid #ddd',
                    }}
                  />
                  <span className="text-white" style={{ marginLeft: '10px' }}>
                    Total: ₹{
                      (selectedItems[cat.category_id]?.find((i) => i.item_id === item.item_id)?.quantity || 1) *
                      item.price_pu
                    }
                  </span>
                </div>
              )}
            </motion.div>
          ))}
        </div>
      ))}
  
        <div style={{ marginBottom: '20px', width: '100%' }}>
          <label className="text-white">Add Additional Cost:</label>
          <input
            type="number"
            value={additionalCost}
            onChange={(e) => setAdditionalCost(e.target.value)}
            className="bg-gray-700 text-white"
            style={{
              padding: '10px',
              marginBottom: '10px',
              width: '100%',
              borderRadius: '5px',
              border: '1px solid #ddd',
            }}
          />
        </div>
  
        <h3 className="text-white">Total Cost: ₹{totalCost.toFixed(2)}</h3>
  
        <div className="flex gap-4">
          <motion.button
            onClick={saveQuote}
            className="px-6 py-2 bg-green-600 text-white rounded-lg shadow-md hover:bg-green-700 transition-colors"
            whileHover={{ scale: 1.05 }} // Scale up on hover
            whileTap={{ scale: 0.95 }} // Scale down on click
          >
            Save Quote
          </motion.button>
          {loading && <div className="text-gray-500">Saving...</div>}

          {successMessage && <div className="text-green-500">{successMessage}</div>}
          <motion.button
            onClick={generateQuote}
            className="px-6 py-2 bg-blue-600 text-white rounded-lg shadow-md hover:bg-blue-700 transition-colors"
            whileHover={{ scale: 1.05 }} // Scale up on hover
            whileTap={{ scale: 0.95 }} // Scale down on click
          >
            Generate Quote
          </motion.button>
        </div>
      </motion.div>
  
      {/* Display Generated Quote PDF */}
      {generatedQuote && (
        <motion.div
          style={{ marginTop: '20px' }}
          initial={{ opacity: 0, y: 20 }} // Initial animation state
          animate={{ opacity: 1, y: 0 }} // Animate to this state
          transition={{ duration: 0.5 }} // Animation duration
        >
          <h3 className="text-white">Generated Quote</h3>
          <iframe src={generatedQuote} width="100%" height="600px" title="Generated Quote" />
        </motion.div>
      )}
       <style jsx>{`
        .button {
          display: block;
          position: absolute;
          top: 16px;
          left: 16px;
          width: 56px;
          height: 56px;
          margin: 0;
          overflow: hidden;
          outline: none;
          background-color: transparent;
          cursor: pointer;
          border: 0;
          z-index: 10;
        }

        .button:before,
        .button:after {
          content: "";
          position: absolute;
          border-radius: 50%;
          inset: 7px;
        }

        .button:before {
          border: 4px solid #f0eeef;
          transition: opacity 0.4s cubic-bezier(0.77, 0, 0.175, 1) 80ms,
            transform 0.5s cubic-bezier(0.455, 0.03, 0.515, 0.955) 80ms;
        }

        .button:after {
          border: 4px solid rgb(240, 243, 244);
          transform: scale(1.3);
          transition: opacity 0.4s cubic-bezier(0.165, 0.84, 0.44, 1),
            transform 0.5s cubic-bezier(0.25, 0.46, 0.45, 0.94);
          opacity: 0;
        }

        .button:hover:before,
        .button:focus:before {
          opacity: 0;
          transform: scale(0.7);
          transition: opacity 0.4s cubic-bezier(0.165, 0.84, 0.44, 1),
            transform 0.5s cubic-bezier(0.25, 0.46, 0.45, 0.94);
        }

        .button:hover:after,
        .button:focus:after {
          opacity: 1;
          transform: scale(1);
          transition: opacity 0.4s cubic-bezier(0.77, 0, 0.175, 1) 80ms,
            transform 0.5s cubic-bezier(0.455, 0.03, 0.515, 0.955) 80ms;
        }

        .button-box {
          display: flex;
          position: absolute;
          top: 0;
          left: 0;
        }

        .button-elem {
          display: block;
          width: 20px;
          height: 20px;
          margin: 17px 18px 0 18px;
          transform: rotate(0deg); /* Arrow faces left by default */
          fill: #f0eeef;
        }

        .button:hover .button-box,
        .button:focus .button-box {
          transition: 0.4s;
          transform: translateX(-56px);
        }
      `}</style>
      </div>
    </div>
  );
}
  export default QuoteManager;